CREATE DEFINER=`root`@`localhost` FUNCTION `get_distance`(var_village INT,var_target_village INT) RETURNS float
    READS SQL DATA
    DETERMINISTIC
BEGIN

DECLARE var_village_x INT;
DECLARE var_village_y INT;
DECLARE var_target_village_x INT;
DECLARE var_target_village_y INT;
DECLARE var_distance FLOAT;

CALL get_village_location(var_village,var_village_x,var_village_y);
CALL get_village_location(var_target_village,var_target_village_x,var_target_village_y);

SET var_distance := SQRT(POW(var_target_village_x-var_village_x,2)+POW(var_target_village_y-var_village_y,2));

RETURN var_distance;
END ;;
DELIMITER ;
