CREATE DEFINER=`root`@`localhost` FUNCTION `get_new_attack`() RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

DECLARE var_attack INT;

SELECT MAX(attack)
INTO var_attack 
FROM villages_troops_attacks LOCK IN SHARE MODE;

IF var_attack IS NULL
THEN
	SET var_attack := 0;
ELSE
	SET var_attack := var_attack;
END IF;

SET var_attack := var_attack + 1;


RETURN var_attack;
END ;;
