CREATE DEFINER=`root`@`localhost` FUNCTION `get_travel_time`(var_troop INT,var_village INT,var_target_village INT) RETURNS time
    READS SQL DATA
    DETERMINISTIC
BEGIN

DECLARE var_travel_time TIME;
DECLARE var_distance INT;
DECLARE var_speed INT;

SET var_distance := get_distance(var_village,var_target_village);

SELECT iv.value INTO var_speed
FROM troops_stats ts
LEFT JOIN mem_integer_variables iv ON ts.value_iv = iv.idiv
LEFT JOIN attributes a ON ts.attribute = a.ida
WHERE a.attribute = "troop_speed"  
AND ts.troop = var_troop;

SET var_travel_time := SEC_TO_TIME(var_distance / var_speed * 3600); 

RETURN var_travel_time;
END ;;
