CREATE DEFINER=`root`@`localhost` FUNCTION `random_integer`(var_min_value INT,var_max_value INT) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
BEGIN

DECLARE var_value INT;

SET var_value := FLOOR(var_min_value + (RAND() * (var_max_value + 1 - var_min_value)));

