CREATE DEFINER=`root`@`localhost` PROCEDURE `buy_building`(IN var_village INT, IN var_building INT)
BEGIN

DECLARE var_idbp INT;
DECLARE var_building_id INT;
DECLARE var_attribute_id INT;
DEClARE var_value INT;
DECLARE var_execution_time TIMESTAMP DEFAULT NOW();
DECLARE var_finished_time TIMESTAMP;
DECLARE var_status_id INT;
DECLARE var_finished INT DEFAULT 0;
DECLARE var_verification INT;

DECLARE curs CURSOR FOR 
SELECT bp.idbp,bp.building,bp.attribute,iv.value 
FROM buildings_prices bp
LEFT JOIN mem_integer_variables iv ON bp.value_iv = iv.idiv
WHERE building = var_building;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_finished = 1;

OPEN curs;

sync_process: LOOP

FETCH curs INTO var_idbp,var_building_id,var_attribute_id,var_value;

IF var_finished = 1 THEN
	LEAVE sync_process;
END IF;

INSERT INTO villages_resources
SET
village := var_village,
attribute := var_attribute_id,
value := (var_value * -1),
execution_time := var_execution_time;


END LOOP sync_process;

CLOSE curs;

SELECT (NOW() + dv.value) INTO  var_finished_time
FROM buildings_build_times bbt
LEFT JOIN mem_datetime_variables dv ON dv.iddv = bbt.build_time_dv
WHERE bbt.building = var_building;
SET var_status_id := get_varchar_variables_id("iteration_once");

INSERT INTO villages_buildings_builds_schedules
SET
village := var_village,
building := var_building,
finished := var_finished_time,
status_vv := var_status_id;

END ;;
DELIMITER ;
