CREATE DEFINER=`root`@`localhost` PROCEDURE `buy_troop`(IN var_village INT, IN var_troop INT, IN var_troop_amount INT)
BEGIN

DECLARE var_idtp INT;
DECLARE var_troop_id INT;
DECLARE var_attribute_id INT;
DEClARE var_value INT;
DECLARE var_execution_time TIMESTAMP DEFAULT NOW();
DECLARE var_finished_time TIMESTAMP;
DECLARE var_status_id INT;
DECLARE var_finished INT DEFAULT 0;
DECLARE var_verification INT;

DECLARE curs CURSOR FOR 
SELECT tp.idtp,tp.troop,tp.attribute,iv.value 
FROM troops_prices tp
LEFT JOIN mem_integer_variables iv ON tp.value_iv = iv.idiv
WHERE troop = var_troop;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_finished = 1;

OPEN curs;

sync_process: LOOP

FETCH curs INTO var_idtp,var_troop_id,var_attribute_id,var_value;

