execution_time := var_execution_time;


END LOOP sync_process;

CLOSE curs;

SELECT (NOW() + dv.value) INTO  var_finished_time
FROM troops_build_times tbt
LEFT JOIN mem_datetime_variables dv ON dv.iddv = tbt.build_time_dv
