CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_village_resource_schedule_from_resources_buildings`(IN var_idvb INT, IN var_idv INT, IN var_idb INT)
BEGIN

DECLARE var_attribute_id INT;
DECLARE var_value_id INT;
DECLARE var_interlude_id INT;
DECLARE var_iteration_id INT;
DECLARE var_execution_time TIMESTAMP;
DECLARE var_idvas INT;

IF(EXISTS(SELECT idrb FROM resources_buildings WHERE building = var_idb) = TRUE)
THEN

SELECT attribute,value_iv,interlude_dv,iteration_vv 
INTO var_attribute_id,var_value_id,var_interlude_id,var_iteration_id
FROM resources_buildings WHERE building = var_idb;

SET var_execution_time := NOW() + get_datetime_variables_from_id(var_interlude_id);


SET var_idvas := get_new_idvas();


INSERT 
INTO villages_resources_schedules SET
idvas := var_idvas,
village := var_idv,
attribute := var_attribute_id,
value_iv := var_value_id,
execution_time := var_execution_time,
interlude_dv := var_interlude_id,
iteration_vv := var_iteration_id;

INSERT INTO villages_buildings_resources_schedules SET
village_building := var_idvb,
village_resource_schedule := var_idvas;

END IF;
END ;;
