CREATE DEFINER=`root`@`localhost` PROCEDURE `order_attack`(IN var_village INT,IN var_troop VARCHAR(50),IN var_target_village INT)
BEGIN

DECLARE var_process VARCHAR(50);
DECLARE var_next_process VARCHAR(50);
DECLARE var_marker_a INT;
DECLARE var_troop_type VARCHAR(50);
DECLARE var_troop_id INT;
DECLARE var_troop_amount INT;
DECLARE var_marker_k INT;
DECLARE var_attack INT;
DECLARE var_idvt INT;
DECLARE var_status_away INT;
DECLARE var_verificator INT;
DECLARE var_speedless_troop INT;
DECLARE var_speed_value INT;
DECLARE var_attribute_id INT;
DECLARE var_travel_time TIME;
DECLARE var_status_id INT;

SET var_attack := get_new_attack();

REPEAT

SET var_marker_a := LOCATE("&",var_troop);

IF var_marker_a != 0 THEN
	SET var_process := SUBSTRING(var_troop,1,var_marker_a - 1);
	SET var_next_process := SUBSTRING(var_troop,var_marker_a + 1);
ELSE
	SET var_process := SUBSTRING(var_troop,var_marker_a + 1);
END IF;

SET var_troop := var_next_process;

SET var_marker_k := LOCATE("#",var_process);

SET var_troop_type := SUBSTRING(var_process,1,var_marker_k - 1);
SET var_troop_amount := SUBSTRING(var_process,var_marker_k + 1);
SET var_troop_id := get_troop_id(var_troop_type);

SELECT IFNULL(SUM(value),0) INTO var_verificator FROM villages_troops
WHERE village = var_village AND troop = var_troop_id;

IF var_troop_amount > var_verificator THEN

	SET SQL_SAFE_UPDATES=0;

	DELETE villages_troops,villages_troops_attacks
	FROM villages_troops
	INNER JOIN villages_troops_attacks 
	ON villages_troops.idvt = villages_troops_attacks.village_troop
	WHERE villages_troops_attacks.attack = var_attack;

	SET SQL_SAFE_UPDATES=1;

	SET var_marker_a := 0;

ELSE 
	
	IF var_troop_amount != 0 THEN

		SET var_idvt := get_new_idvt();
		SET var_status_away := get_varchar_variables_id("troop_away");

		INSERT INTO villages_troops
		SET
		idvt := var_idvt,
		village := var_village,
		troop := var_troop_id,
		value := var_troop_amount * -1,
		execution_time := NOW(),
		status_vv := var_status_away;

		INSERT INTO villages_troops_attacks
		SET
		attack := var_attack,
		village_troop := var_idvt;

	END IF;
	
END IF;

UNTIL var_marker_a = 0 END REPEAT;

SET var_attribute_id := get_attribute_id("troop_speed");

SELECT vt.troop,MIN(iv.value) INTO var_speedless_troop,var_speed_value 
FROM villages_troops_attacks vta
LEFT JOIN villages_troops vt ON vt.idvt = vta.village_troop
LEFT JOIN troops_stats ts ON ts.troop = vt.troop
LEFT JOIN mem_integer_variables iv ON iv.idiv = ts.value_iv
WHERE ts.attribute = var_attribute_id
AND vta.attack = var_attack;

IF var_speedless_troop IS NOT NULL THEN

SET var_travel_time := get_travel_time(var_speedless_troop,var_village,var_target_village);
SET var_status_id := get_varchar_variables_id("troop_away");


INSERT INTO villages_troops_attacks_schedules
SET 
village_troop_attack := var_attack,
target_village := var_target_village,
execution_time := ADDTIME(NOW(),var_travel_time),
status_vv := var_status_id;

END IF;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
