CREATE DEFINER=`root`@`localhost` PROCEDURE `order_building`(IN var_village INT,IN var_building VARCHAR(50))
BEGIN

DECLARE var_building_id INT;
DECLARE var_verification INT;
DECLARE var_verificator INT;
DECLARE var_building_build_slot INT;
DECLARE var_slot INT;
DECLARE var_used_slot INT;
DECLARE var_status_vv_id INT;

SET var_building_build_slot := get_integer_variables("building_build_slot");
SET var_building_id := get_building_id("town_center");

SELECT COUNT(building) * var_building_build_slot INTO var_slot
FROM villages_buildings
WHERE village = var_village AND building = var_building_id;

SET var_status_vv_id := get_varchar_variables_id("iteration_once");

SELECT COUNT(building) + 1 INTO var_used_slot
FROM villages_buildings_builds_schedules
WHERE village = var_village AND status_vv = var_status_vv_id;

IF var_used_slot <= var_slot THEN

SET var_building_id := get_building_id(var_building);

SELECT COUNT(idbp) INTO var_verification 
FROM buildings_prices
WHERE building = var_building_id;

SELECT COUNT(bp.building) INTO var_verificator
FROM buildings_prices bp
LEFT JOIN mem_integer_variables iv ON iv.idiv = bp.value_iv
LEFT JOIN
(
	SELECT village,attribute,SUM(value) AS resource
	FROM villages_resources
	GROUP BY village,attribute
	HAVING village = var_village
) AS va ON va.attribute = bp.attribute
WHERE bp.building = var_building_id AND va.resource >= iv.value;

IF var_verification = var_verificator THEN
CALL buy_building(var_village,var_building_id);
END IF;

END IF;

END ;;
