CREATE DEFINER=`root`@`localhost` PROCEDURE `order_troop`(IN var_village INT,IN var_troop VARCHAR(50), IN var_troop_amount INT)
BEGIN

DECLARE var_troop_id INT;
DECLARE var_building_id INT;
DECLARE var_verification INT;
DECLARE var_verificator INT;
DECLARE var_troop_build_slot INT;
DECLARE var_slot INT;
DECLARE var_used_slot INT;
DECLARE var_status_vv_id INT;

SET var_troop_build_slot := get_integer_variables("troop_build_slot");
SET var_building_id := get_building_id("barrack");

SELECT COUNT(building) * var_troop_build_slot INTO var_slot
FROM villages_buildings
WHERE village = var_village AND building = var_building_id;

SET var_status_vv_id := get_varchar_variables_id("iteration_once");

SELECT IFNULL(SUM(value),0) + var_troop_amount INTO var_used_slot
FROM villages_troops_builds_schedules
WHERE village = var_village AND status_vv = var_status_vv_id;

IF var_used_slot <= var_slot THEN

SET var_troop_id := get_troop_id(var_troop);

SELECT COUNT(idtp) INTO var_verification 
FROM troops_prices
WHERE troop = var_troop_id;

SELECT COUNT(tp.troop) INTO var_verificator
FROM troops_prices tp
LEFT JOIN mem_integer_variables iv ON iv.idiv = tp.value_iv
LEFT JOIN
(
	SELECT village,attribute,SUM(value) AS resource
	FROM villages_resources
	GROUP BY village,attribute
	HAVING village = var_village
) AS va ON va.attribute = tp.attribute
WHERE tp.troop = var_troop_id AND va.resource >= iv.value * var_troop_amount;


IF var_verification = var_verificator THEN
CALL buy_troop(var_village,var_troop_id,var_troop_amount);
END IF;

END IF;


END ;;
