CREATE DEFINER=`root`@`localhost` PROCEDURE `random_village_axis`(OUT var_x_axis INT, OUT var_y_axis INT)
BEGIN

DECLARE var_map_size_x_min INT;
DECLARE var_map_size_x_max INT;
DECLARE var_map_size_y_min INT;
DECLARE var_map_size_y_max INT;
DECLARE var_verification INT;
DECLARE var_attribute_x_axis INT;
DECLARE var_attribute_y_axis INT;


SET var_map_size_x_min = get_integer_variables("map_size_x_min");
SET var_map_size_x_max = get_integer_variables("map_size_x_max");
SET var_map_size_y_min = get_integer_variables("map_size_y_min");
SET var_map_size_y_max = get_integer_variables("map_size_y_max");

SET var_attribute_x_axis := get_attribute_id("x_axis");
SET var_attribute_y_axis := get_attribute_id("y_axis");

REPEAT

SET var_x_axis := random_integer(var_map_size_x_min,var_map_size_x_max);
SET var_y_axis := random_integer(var_map_size_y_min,var_map_size_y_max);

SELECT COUNT(*) INTO var_verification 
FROM
(
	SELECT village, COUNT(village) as summary 
	FROM villages_locations 
	WHERE (attribute = var_attribute_x_axis AND value = var_x_axis) 
	OR (attribute = var_attribute_y_axis AND value = var_y_axis) 
	GROUP BY village
) 
AS cek WHERE summary > 1;

UNTIL var_verification = 0

END REPEAT;

END ;;
