DECLARE var_status_done INT;


DECLARE curs CURSOR FOR 
SELECT idvbbs,village,building,finished,status_vv 
FROM villages_buildings_builds_schedules
WHERE finished <= NOW() AND status_vv != var_status_req FOR UPDATE;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_finished = 1;

OPEN curs;

sync_process: LOOP

FETCH curs INTO var_idvbbs,var_village,var_building,var_finished_build,var_status_vv;

IF var_finished = 1 THEN
	LEAVE sync_process;
