CREATE DEFINER=`root`@`localhost` PROCEDURE `villages_resources_scheduling`()
BEGIN


DECLARE var_idvas INT;
DECLARE var_village INT;
DECLARE var_attribute VARCHAR(45);
DECLARE var_value_iv INT;
DECLARE var_execution_time TIMESTAMP;
DECLARE var_interlude_dv INT;
DECLARE var_iteration_vv INT;
DECLARE var_iteration_req INT DEFAULT get_varchar_variables_id("iteration_done");
DECLARE var_value INT;
DECLARE var_new_execution_time DATETIME;
DECLARE var_interlude DATETIME;
DECLARE var_finished INT DEFAULT 0;
DECLARE var_check_iteration INT;
DECLARE var_iteration_done INT;


DECLARE curs CURSOR FOR 
SELECT idvas,village,attribute,value_iv,execution_time,interlude_dv,iteration_vv 
FROM villages_resources_schedules
WHERE execution_time <= NOW() AND iteration_vv != var_iteration_req FOR UPDATE;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_finished = 1;

OPEN curs;

sync_process: LOOP

FETCH curs INTO var_idvas,var_village,var_attribute,var_value_iv,var_execution_time,var_interlude_dv,var_iteration_vv;

IF var_finished = 1 THEN
	LEAVE sync_process;
END IF;

SET var_value := get_integer_variables_from_id(var_value_iv);

INSERT INTO villages_resources
SET
village := var_village,
attribute := var_attribute,
value := var_value,
execution_time := NOW();

SET var_check_iteration := get_varchar_variables_id("iteration_once");

IF var_iteration_vv = var_check_iteration THEN

	SET var_iteration_done := get_varchar_variables_id("iteration_done");

	UPDATE villages_resources_schedules
	SET iteration_vv := var_iteration_done
	WHERE idvas = var_idvas;

END IF;

SET var_check_iteration := get_varchar_variables_id("iteration_frequently");

IF var_iteration_vv = var_check_iteration THEN
	
	SET var_interlude := get_datetime_variables_from_id(var_interlude_dv);
	SET var_new_execution_time := NOW() + var_interlude;
	UPDATE villages_resources_schedules
	SET execution_time := var_new_execution_time
	WHERE idvas = var_idvas;

END IF;

END LOOP sync_process;

CLOSE curs;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `villages_troops_attacks_scheduling` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `villages_troops_attacks_scheduling`()
BEGIN


DECLARE var_idvtas INT;
DECLARE var_village_troop_attack INT;
DECLARE var_target_village INT;
DECLARE var_execution_time TIMESTAMP;
DECLARE var_status_vv INT;
DECLARE var_status_req INT DEFAULT get_varchar_variables_id("troop_home");
DECLARE var_finished INT DEFAULT 0;
DECLARE var_status_done INT;
DECLARE var_attack INT;
DECLARE var_defense INT;
DECLARE var_survival INT;
DECLARE var_point INT;
DECLARE var_min_point INT;
DECLARE var_max_point INT;
DECLARE var_attack_point INT;
DECLARE var_defense_point INT;
DECLARE var_defense_troop VARCHAR(50);
DECLARE var_attack_troop VARCHAR(50);
DECLARE var_temp_troop VARCHAR(50);
DECLARE var_temp_resource VARCHAR(50);
DECLARE var_target_village_resource VARCHAR(50);
DECLARE var_process VARCHAR(50);
DECLARE var_next_process VARCHAR(50);
DECLARE var_marker_a INT;
DECLARE var_marker_k INT;
DECLARE var_troop_type INT;
DECLARE var_troop_amount INT;
DECLARE var_victim VARCHAR(50);
DECLARE var_victim_type INT;
DECLARE var_victim_amount INT;
DECLARE var_survivor VARCHAR(50);
DECLARE var_survivor_type INT;
DECLARE var_survivor_amount INT;
DECLARE var_speedless_troop INT;
DECLARE var_speedless_troop_speed INT;
DECLARE var_village INT;
DECLARE var_survivor_carrying_capacity INT;
DECLARE var_resource_type INT;
DECLARE var_resource_amount INT;
DECLARE var_war_loot VARCHAR(50);
DECLARE var_war_loot_type INT;
DECLARE var_war_loot_amount INT;
DECLARE var_travel_time TIME;
DECLARE var_status_dead INT DEFAULT get_varchar_variables_id("troop_dead");
DECLARE var_status_home INT DEFAULT get_varchar_variables_id("troop_home");
DECLARE var_status_back INT DEFAULT get_varchar_variables_id("troop_back");
DECLARE var_iteration_once INT DEFAULT get_varchar_variables_id("iteration_once");
DECLARE var_idvt INT;

DECLARE curs CURSOR FOR 
SELECT idvtas,village_troop_attack,target_village,execution_time,status_vv 
FROM villages_troops_attacks_schedules
WHERE execution_time <= NOW() AND status_vv != var_status_req FOR UPDATE;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_finished = 1;

OPEN curs;

sync_process: LOOP

FETCH curs INTO var_idvtas,var_village_troop_attack,var_target_village,var_execution_time,var_status_vv;

IF var_finished = 1 THEN
	LEAVE sync_process;
END IF;

SELECT SUM(vt.value * iv.value) INTO var_attack
FROM villages_troops_attacks vta
LEFT JOIN villages_troops vt ON vt.idvt = vta.village_troop
LEFT JOIN troops_stats ts ON ts.troop = vt.troop
LEFT JOIN mem_integer_variables iv ON iv.idiv = ts.value_iv
LEFT JOIN attributes a ON a.ida = ts.attribute
WHERE a.attribute = "attack_point" AND vta.attack = var_village_troop_attack;

SELECT IFNULL(SUM(vt.value*iv.value),0) INTO var_defense
FROM villages_troops vt
LEFT JOIN troops_stats ts ON ts.troop = vt.troop
LEFT JOIN mem_integer_variables iv ON iv.idiv = ts.value_iv
LEFT JOIN attributes a ON a.ida = ts.attribute
WHERE a.attribute = "defense_point" AND vt.village = var_target_village;

SET var_survival := var_attack + var_defense;

SELECT GROUP_CONCAT(CONCAT(at.troop,"#",at.amount) SEPARATOR "&")
INTO var_attack_troop
FROM
(SELECT vt.troop,SUM(vt.value)*-1 AS amount
FROM villages_troops_attacks vta
LEFT JOIN villages_troops vt ON vta.village_troop = vt.idvt
WHERE vta.attack = var_village_troop_attack
GROUP BY vt.troop) AS at;

SELECT GROUP_CONCAT(CONCAT(vt.troop,"#",vt.amount) SEPARATOR "&")
INTO var_defense_troop
FROM
(SELECT troop,SUM(value) AS amount 
FROM villages_troops 
WHERE village = var_target_village
GROUP BY troop) AS vt;


IF var_survival < 0 THEN 

	SELECT 
	IF((-1*var_survival)-MIN(iv.value)<0,0,(-1*var_survival)-MIN(iv.value)),
	IF((-1*var_survival)+MIN(iv.value)<0,0,(-1*var_survival)+MIN(iv.value))  
	INTO var_min_point,var_max_point
	FROM villages_troops_attacks vta
	LEFT JOIN villages_troops vt ON vta.village_troop = vt.idvt
	LEFT JOIN troops_stats ts ON ts.troop = vt.troop	
	LEFT JOIN mem_integer_variables iv ON iv.idiv = ts.value_iv
	LEFT JOIN attributes a ON a.ida = ts.attribute
	WHERE a.attribute = "attack_point" AND vta.attack = var_village_troop_attack;
	
	SET var_temp_troop := var_attack_troop;
	REPEAT
		
		SET var_point := 0;
		SET var_survivor := NULL;
		SET var_attack_troop := var_temp_troop;

		REPEAT

			SET var_marker_a := LOCATE("&",var_attack_troop);
			IF var_marker_a != 0 THEN
				SET var_process := SUBSTRING(var_attack_troop,1,var_marker_a - 1);
				SET var_next_process := SUBSTRING(var_attack_troop,var_marker_a + 1);
			ELSE
				SET var_process := SUBSTRING(var_attack_troop,var_marker_a + 1);
			END IF;
		
			SET var_attack_troop := var_next_process;

			SET var_marker_k := LOCATE("#",var_process);

			SET var_troop_type := SUBSTRING(var_process,1,var_marker_k - 1);
			SET var_troop_amount := SUBSTRING(var_process,var_marker_k + 1);

			SET var_survivor_amount := random_integer(0,var_troop_amount);

			SELECT iv.value INTO var_attack_point
			FROM troops_stats ts
			LEFT JOIN mem_integer_variables iv ON ts.value_iv = iv.idiv
			LEFT JOIN attributes a ON ts.attribute = a.ida
			WHERE a.attribute = "attack_point" AND troop = var_troop_type;

			SET var_point := var_point + (var_survivor_amount * var_attack_point);

			IF var_survivor IS NULL THEN
				
				SET var_survivor := CONCAT(var_troop_type,"#",var_survivor_amount);
				
			ELSE
				
				SET var_survivor := CONCAT(var_survivor,"&",var_troop_type,"#",var_survivor_amount);

			END IF;

		UNTIL var_marker_a = 0 END REPEAT;
		
	UNTIL var_point >= var_min_point AND var_point <= var_max_point END REPEAT;

	SET var_attack_troop := var_temp_troop;

	SELECT 
	vt.troop,vt.village,MIN(iv.value)  
	INTO var_speedless_troop,var_village,var_speedless_troop_speed
	FROM villages_troops_attacks vta
	LEFT JOIN villages_troops vt ON vta.village_troop = vt.idvt
	LEFT JOIN troops_stats ts ON ts.troop = vt.troop	
	LEFT JOIN mem_integer_variables iv ON iv.idiv = ts.value_iv
	LEFT JOIN attributes a ON a.ida = ts.attribute
	WHERE a.attribute = "troop_speed" AND vta.attack = var_village_troop_attack;

	SET var_travel_time := ADDTIME(NOW(),get_travel_time(var_speedless_troop,var_village,var_target_village));

	SET var_survivor_carrying_capacity := 0;

	SET var_temp_troop := var_survivor;
	REPEAT

		SET var_marker_a := LOCATE("&",var_survivor);
		IF var_marker_a != 0 THEN
			SET var_process := SUBSTRING(var_survivor,1,var_marker_a - 1);
			SET var_next_process := SUBSTRING(var_survivor,var_marker_a + 1);
		ELSE
			SET var_process := SUBSTRING(var_survivor,var_marker_a + 1);
		END IF;
		
		SET var_survivor := var_next_process;

		SET var_marker_k := LOCATE("#",var_process);

		SET var_survivor_type := SUBSTRING(var_process,1,var_marker_k - 1);
		SET var_survivor_amount := SUBSTRING(var_process,var_marker_k + 1);

		SELECT var_survivor_carrying_capacity+(iv.value*var_survivor_amount)
		INTO var_survivor_carrying_capacity
		FROM troops_stats ts
		LEFT JOIN attributes a ON ts.attribute = a.ida
		LEFT JOIN mem_integer_variables iv ON ts.value_iv = iv.idiv
		WHERE a.attribute = "carrying_capacity" AND ts.troop = var_survivor_type;

		INSERT INTO villages_troops_builds_schedules
		SET
		village := var_village,
		troop := var_survivor_type,
		value := var_survivor_amount,
		finished := var_travel_time,
		status_vv := var_status_back;
		
	UNTIL var_marker_a = 0 END REPEAT;

	SET var_survivor := var_temp_troop;

	SELECT GROUP_CONCAT(CONCAT(vr.attribute,"#",vr.amount) SEPARATOR "&")
	INTO var_target_village_resource
	FROM
	(
		SELECT village,attribute,SUM(value) AS amount 
		FROM villages_resources
		WHERE village = var_target_village
		GROUP BY attribute
	) AS vr;
	

	SET var_temp_resource := var_target_village_resource;
	REPEAT

		SET var_point := 0;
		SET var_war_loot := NULL;
		SET var_target_village_resource := var_temp_resource;

		REPEAT

			SET var_marker_a := LOCATE("&",var_target_village_resource);
			IF var_marker_a != 0 THEN
				SET var_process := SUBSTRING(var_target_village_resource,1,var_marker_a - 1);
				SET var_next_process := SUBSTRING(var_target_village_resource,var_marker_a + 1);
			ELSE
				SET var_process := SUBSTRING(var_target_village_resource,var_marker_a + 1);
			END IF;
		
			SET var_target_village_resource := var_next_process;

			SET var_marker_k := LOCATE("#",var_process);

			SET var_resource_type := SUBSTRING(var_process,1,var_marker_k - 1);
			SET var_resource_amount := SUBSTRING(var_process,var_marker_k + 1);

			SET var_war_loot_type := var_resource_type;

			IF(var_resource_amount <= var_survivor_carrying_capacity) THEN

				SET var_war_loot_amount := random_integer(0,var_resource_amount);

			ELSE
	
				SET var_war_loot_amount := random_integer(0,var_survivor_carrying_capacity);

			END IF;

			SET var_point := var_point + var_war_loot_amount;

			IF var_war_loot IS NULL THEN
				
				SET var_war_loot := CONCAT(var_war_loot_type,"#",var_war_loot_amount);
				
			ELSE
				
				SET var_war_loot := CONCAT(var_war_loot,"&",var_war_loot_type,"#",var_war_loot_amount);

			END IF;		
		
		UNTIL var_marker_a = 0 END REPEAT;

	UNTIL var_point <= var_survivor_carrying_capacity END REPEAT;
	
	SET var_target_village_resource := var_temp_resource;

	
		


	SET var_temp_resource := var_war_loot;
	REPEAT

		SET var_marker_a := LOCATE("&",var_war_loot);
		IF var_marker_a != 0 THEN
			SET var_process := SUBSTRING(var_war_loot,1,var_marker_a - 1);
			SET var_next_process := SUBSTRING(var_war_loot,var_marker_a + 1);
		ELSE
			SET var_process := SUBSTRING(var_war_loot,var_marker_a + 1);
		END IF;
		
		SET var_war_loot := var_next_process;

		SET var_marker_k := LOCATE("#",var_process);

		SET var_war_loot_type := SUBSTRING(var_process,1,var_marker_k - 1);
		SET var_war_loot_amount := SUBSTRING(var_process,var_marker_k + 1);

		INSERT INTO wars_loots_schedules
		SET
		village := var_village,
		attribute := var_war_loot_type,
		value := var_war_loot_amount,
		execution_time := var_travel_time,
		status_vv := var_iteration_once;

		INSERT INTO villages_resources
		SET
		village := var_target_village,
		attribute := var_war_loot_type,
		value := -1*var_war_loot_amount,
		execution_time := var_travel_time;


	UNTIL var_marker_a = 0 END REPEAT;
	SET var_war_loot := var_temp_resource;

	SET SQL_SAFE_UPDATES=0;

	UPDATE villages_troops vt
	LEFT JOIN villages_troops_attacks vta ON vta.village_troop = vt.idvt
	SET vt.status_vv := var_status_dead
	WHERE vta.attack = var_village_troop_attack;

	SET SQL_SAFE_UPDATES=1;
	
	IF var_defense != 0 THEN
	REPEAT
	
		SET var_marker_a := LOCATE("&",var_defense_troop);
		IF var_marker_a != 0 THEN
			SET var_process := SUBSTRING(var_defense_troop,1,var_marker_a - 1);
			SET var_next_process := SUBSTRING(var_defense_troop,var_marker_a + 1);
		ELSE
			SET var_process := SUBSTRING(var_defense_troop,var_marker_a + 1);
		END IF;
		
		SET var_defense_troop := var_next_process;

		SET var_marker_k := LOCATE("#",var_process);

		SET var_troop_type := SUBSTRING(var_process,1,var_marker_k - 1);
		SET var_troop_amount := SUBSTRING(var_process,var_marker_k + 1);
	
		SET var_idvt := get_new_idvt();

		INSERT INTO villages_troops
		SET
		idvt := var_idvt,
		village := var_target_village,
		troop := var_troop_type,
		value := var_troop_amount * -1,
		execution_time := var_execution_time,
		status_vv := var_status_dead;

	UNTIL var_marker_a = 0 END REPEAT;
	END IF;

ELSEIF var_survival > 0 THEN 

	SELECT 
	var_defense-(var_survival-MIN(iv.value)),
	var_defense-(var_survival+MIN(iv.value)) 
	INTO var_max_point,var_min_point
	FROM villages_troops vt
	LEFT JOIN troops_stats ts ON ts.troop = vt.troop	
	LEFT JOIN mem_integer_variables iv ON iv.idiv = ts.value_iv
	LEFT JOIN attributes a ON a.ida = ts.attribute
	WHERE a.attribute = "defense_point" AND vt.village = var_target_village;
	
	SET var_temp_troop := var_defense_troop;
	REPEAT
		
		SET var_point := 0;
		SET var_victim := NULL;
		SET var_defense_troop := var_temp_troop;

		REPEAT

			SET var_marker_a := LOCATE("&",var_defense_troop);
			IF var_marker_a != 0 THEN
				SET var_process := SUBSTRING(var_defense_troop,1,var_marker_a - 1);
				SET var_next_process := SUBSTRING(var_defense_troop,var_marker_a + 1);
			ELSE
				SET var_process := SUBSTRING(var_defense_troop,var_marker_a + 1);
			END IF;
		
			SET var_defense_troop := var_next_process;

			SET var_marker_k := LOCATE("#",var_process);

			SET var_troop_type := SUBSTRING(var_process,1,var_marker_k - 1);
			SET var_troop_amount := SUBSTRING(var_process,var_marker_k + 1);

			SET var_victim_amount := random_integer(0,var_troop_amount);

			SELECT iv.value INTO var_defense_point
			FROM troops_stats ts
			LEFT JOIN mem_integer_variables iv ON ts.value_iv = iv.idiv
			LEFT JOIN attributes a ON ts.attribute = a.ida
			WHERE a.attribute = "defense_point" AND troop = var_troop_type;

			SET var_point := var_point + (var_victim_amount * var_defense_point);

			IF var_victim IS NULL THEN
				
				SET var_victim := CONCAT(var_troop_type,"#",var_victim_amount);
				
			ELSE
				
				SET var_victim := CONCAT(var_victim,"&",var_troop_type,"#",var_victim_amount);

			END IF;

		UNTIL var_marker_a = 0 END REPEAT;
		
	UNTIL var_point >= var_min_point AND var_point <= var_max_point END REPEAT;
		

	REPEAT

		SET var_marker_a := LOCATE("&",var_victim);
		IF var_marker_a != 0 THEN
			SET var_process := SUBSTRING(var_victim,1,var_marker_a - 1);
			SET var_next_process := SUBSTRING(var_victim,var_marker_a + 1);
		ELSE
			SET var_process := SUBSTRING(var_victim,var_marker_a + 1);
		END IF;
		
		SET var_victim := var_next_process;

		SET var_marker_k := LOCATE("#",var_process);

		SET var_victim_type := SUBSTRING(var_process,1,var_marker_k - 1);
		SET var_victim_amount := SUBSTRING(var_process,var_marker_k + 1);

		SET var_idvt := get_new_idvt();

		INSERT INTO villages_troops
		SET
		idvt := var_idvt,
		village := var_target_village,
		troop := var_victim_type,
		value := var_victim_amount * -1,
		execution_time := var_execution_time,
		status_vv := var_status_dead;
		
	UNTIL var_marker_a = 0 END REPEAT;

	SET SQL_SAFE_UPDATES=0;

	UPDATE villages_troops vt
	LEFT JOIN villages_troops_attacks vta ON vta.village_troop = vt.idvt
	SET vt.status_vv := var_status_dead
	WHERE vta.attack = var_village_troop_attack;	

	SET SQL_SAFE_UPDATES=1;

ELSE 

	SET SQL_SAFE_UPDATES=0;

	UPDATE villages_troops vt
	LEFT JOIN villages_troops_attacks vta ON vta.village_troop = vt.idvt
	SET vt.status_vv := var_status_dead
	WHERE vta.attack = var_village_troop_attack;

	SET SQL_SAFE_UPDATES=1;

	REPEAT
	
		SET var_marker_a := LOCATE("&",var_defense_troop);
		IF var_marker_a != 0 THEN
			SET var_process := SUBSTRING(var_defense_troop,1,var_marker_a - 1);
			SET var_next_process := SUBSTRING(var_defense_troop,var_marker_a + 1);
		ELSE
			SET var_process := SUBSTRING(var_defense_troop,var_marker_a + 1);
		END IF;
		
		SET var_defense_troop := var_next_process;

		SET var_marker_k := LOCATE("#",var_process);

		SET var_troop_type := SUBSTRING(var_process,1,var_marker_k - 1);
		SET var_troop_amount := SUBSTRING(var_process,var_marker_k + 1);
	
		SET var_idvt := get_new_idvt();

		INSERT INTO villages_troops
		SET
		idvt := var_idvt,
		village := var_target_village,
		troop := var_troop_type,
		value := var_troop_amount * -1,
		execution_time := var_execution_time,
		status_vv := var_status_dead;

	UNTIL var_marker_a = 0 END REPEAT;

END IF;

SET SQL_SAFE_UPDATES=0;

UPDATE villages_troops_attacks_schedules
SET
status_vv := var_status_home
WHERE idvtas = var_idvtas;

SET SQL_SAFE_UPDATES=1;

END LOOP sync_process;

CLOSE curs;

END ;;
