DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `villages_troops_builds_scheduling`()
BEGIN


DECLARE var_idvtbs INT;
DECLARE var_village INT;
DECLARE var_troop INT;
DECLARE var_value INT;
DECLARE var_finished_build TIMESTAMP;
DECLARE var_status_vv INT;
DECLARE var_status_req INT DEFAULT get_varchar_variables_id("iteration_done");
DECLARE var_finished INT DEFAULT 0;
DECLARE var_status_done INT;
DECLARE var_status_home INT;
DECLARE var_idvt INT;


DECLARE curs CURSOR FOR 
SELECT idvtbs,village,troop,value,finished,status_vv 
FROM villages_troops_builds_schedules
WHERE finished <= NOW() AND status_vv != var_status_req FOR UPDATE;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_finished = 1;

OPEN curs;

sync_process: LOOP

FETCH curs INTO var_idvtbs,var_village,var_troop,var_value,var_finished_build,var_status_vv;

IF var_finished = 1 THEN
	LEAVE sync_process;
END IF;

SET var_idvt := get_new_idvt();
SET var_status_home := get_varchar_variables_id("troop_home");

INSERT INTO villages_troops
SET
idvt := var_idvt,
village := var_village,
troop := var_troop,
value := var_value,
execution_time := var_finished_build,
status_vv := var_status_home;

SET var_status_done := get_varchar_variables_id("iteration_done");

UPDATE villages_troops_builds_schedules
SET status_vv := var_status_done
WHERE idvtbs = var_idvtbs;


END LOOP sync_process;

CLOSE curs;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
