CREATE DEFINER=`root`@`localhost` PROCEDURE `village_building_registration`(IN var_village INT,IN var_building INT,IN var_amount INT)
BEGIN

DECLARE var_iteration INT DEFAULT 0;

WHILE var_iteration < var_amount AND var_amount > 0 DO

INSERT INTO villages_buildings
SET
village := var_village,
building := var_building;

SET var_iteration :=  var_iteration + 1;

END WHILE;
END ;;
