CREATE DEFINER=`root`@`localhost` PROCEDURE `village_registration`(IN var_player INT,IN var_village_name VARCHAR(45), IN var_x_axis INT, IN var_y_axis INT)
BEGIN

DECLARE var_idv INT;
SET var_idv := get_new_idv();

INSERT INTO villages(idv,player,village_name) VALUES(var_idv,var_player,var_village_name);
