CREATE DEFINER=`root`@`localhost` PROCEDURE `wars_loots_scheduling`()
BEGIN


DECLARE var_idwls INT;
DECLARE var_village INT;
DECLARE var_attribute INT;
DECLARE var_value INT;
DECLARE var_execution_time TIMESTAMP;
DECLARE var_status_vv INT;
DECLARE var_status_req INT DEFAULT get_varchar_variables_id("iteration_done");
DECLARE var_status_done INT DEFAULT get_varchar_variables_id("iteration_done");
DECLARE var_finished INT DEFAULT 0;


DECLARE curs CURSOR FOR 
SELECT idwls,village,attribute,value,execution_time,status_vv 
FROM wars_loots_schedules
WHERE execution_time <= NOW() AND status_vv != var_status_req FOR UPDATE;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_finished = 1;

OPEN curs;

sync_process: LOOP

FETCH curs INTO var_idwls,var_village,var_attribute,var_value,var_execution_time,var_status_vv;

IF var_finished = 1 THEN
	LEAVE sync_process;
END IF;

INSERT INTO villages_resources
SET
village := var_village,
attribute := var_attribute,
value := var_value,
execution_time := var_execution_time;

UPDATE wars_loots_schedules
SET status_vv := var_status_done
WHERE idwls = var_idwls;


END LOOP sync_process;

CLOSE curs;

END ;;
DELIMITER ;
