CREATE DEFINER=`root`@`localhost` PROCEDURE `web_sign_up`(IN var_username VARCHAR(50),IN var_password VARCHAR(50),IN var_password_conf VARCHAR(50),OUT var_status VARCHAR(10))
BEGIN

IF(var_password = var_password_conf) THEN

	CALL web_username_availability(var_username,@var_status);

	IF(@var_status = "yes") THEN

		CALL player_registration(var_username,var_password);
		SET var_status := "success";
	
	ELSE
			
		SET var_status := "error";
	
	END IF;

ELSE

	SET var_status := "error";

END IF;

END ;;
